import React from "react";
import { DataGrid } from "@mui/x-data-grid";
import { Rating } from "@mui/material";

const columns = [
    {
      field: "id",
      headerName: "ID",
      width: 80,
      sortable: false,
    },
    {
      field: "username",
      headerName: "Username",
      sortable: false,
      flex: 1,
      width: 100,
    },
    { field: "Date", headerName: "Date of register", sortable: false, width: 130 },
    { field: "time", headerName: "Time of register", width: 130 },
  ];


const DataTable = ({ products }) => {
  return (
    <div style={{ height: 400, width: "100%" }}>
      <DataGrid
        rows={products}
        columns={columns}
        pageSize={5}
        rowsPerPageOptions={[5]}
        disableColumnMenu
        disableSelectionOnClick
      />
    </div>
  );
};

export default DataTable;
